"use strict"

import { StyleSheet, View, Image } from 'react-native';
import Camera from './Camera';

const Home = (navigation) => {

    return (
        <View>
            <Image
                style={styles.photo}
                source={async () => navigation.getParam("imageData")}
            />
        </View>
    )
}
const styles = StyleSheet.create({
    container: {
        flex: 1,
        flexDirection: 'row',
        justifyContent: 'space-evenly',
        alignItems: 'center',
    },
    photo: {
        flex: 1,
        height: 100,
        width: 50
    }
})

export default Home;
